import React from 'react'
import s from './Header.module.css'

const Header = () => {
    return (
        <div className={s.container}>
            <span className={s.logo}>House Staff</span>
            <span className={s.logo}>House Staff</span>
            <div className={s.presentation}></div>
        </div>
    )
}

export default Header
